@iota・9 

We've released a small miner-only update that allows for uploading models using bfloat16 with the included miner (by flag) or upload_model script (by default).

Without this it was uploading in fp32 instead which could put you over the new 15g limit.

@iota・9 Per taostats we are officially past the 7b block.

This represents a massive step forward for this subnet in terms of model power.

Good luck to everyone competing and for those interested please pay attention for future (non @) posts in this channel for further update posts on the unfolding competition.
